--  DDL for Procedure UTWORZTERMINARZ
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "UTWORZTERMINARZ" 
(
  LIGA IN NUMBER 
, SEZON IN NUMBER 
) AS 
GOSPODARZ NUMBER;
GOSC NUMBER;
I NUMBER;
J NUMBER;
N NUMBER;
CURSOR K_GOSPODARZE IS SELECT ID_DRUZYNY FROM PRZYPISANIA WHERE NR_SEZONU=SEZON AND ID_LIGI=LIGA ;
CURSOR K_GOSCIE IS SELECT ID_DRUZYNY FROM PRZYPISANIA WHERE NR_SEZONU=SEZON AND ID_LIGI=LIGA ;
BEGIN
I:=0;

SELECT COUNT(*) INTO N FROM PRZYPISANIA WHERE NR_SEZONU=SEZON AND ID_LIGI=LIGA;
OPEN K_GOSPODARZE;
LOOP
J:=0;
I:=I+1;
EXIT WHEN I > N;
FETCH K_GOSPODARZE INTO GOSPODARZ;
OPEN K_GOSCIE;
LOOP
J:=J+1;
EXIT WHEN J>N;
FETCH K_GOSCIE INTO GOSC;
IF GOSC<>GOSPODARZ THEN
  DODAJMECZ(LIGA,SEZON,GOSPODARZ,GOSC);
  END IF;
END LOOP;
CLOSE K_GOSCIE;
END LOOP;
  
CLOSE K_GOSPODARZE;
END UTWORZTERMINARZ;

